one. \nChiedi con gentilezza :-)","it"), ("2756","2756","Modifica configurazione plugin","it"), ("2757","2757","Seleziona dal tuo hard disk un&#039;immagine da caricare.","it"), ("2758","2758","immagine","it"), ("2759","2759","Sei sicuro di voler cancellare questo file?","it"), ("2760","2760","Sono state fatte delle modifiche senza salvare, cosa vuoi fare?","it"), ("2761","2761","Procedi senza salvare","it"), ("2762","2762","Salva","it"), ("2764","2764","Il modulo richiesto non esiste","it"), ("2765","2765","Spostami con drag &amp; drop","it"), ("2766","2766","&lt;p&gt;In questo area compariranno i moduli disponibili per il template scelto.&lt;/p&gt;\n&lt;p&gt;Ogni modulo &egrave; rappresentato da un blocco con i bordi arrotondati, contenente nome del modulo e relativa icona per reperirne le informazioni di utilizzo&lt;/p&gt;\n&lt;p&gt;I moduli possono essere spostati nell&#039;area sottostante eseguendo il drag &amp; drop con il mouse&lt;/p&gt;\n&lt;p&gt;\nAlcuni moduli potranno essere aggiunti pi&ugrave; di una volta nella stessa pagina, altri invece possono esistere una sola volta nella pagina.&lt;/p&gt;\n&lt;p&gt;\nI moduli evidenziati sono i moduli creati dinamicamente tramite il bottone posto in alto a destra &quot;Widget Dinamici&quot;. I moduli a fondo bianco sono moduli previsti dal cms e non possono essere modificati.\n&lt;/p&gt;","it"), ("2767","2767","&lt;p&gt;In quest&#039;area comparir&agrave; un&#039;anteprima pi&ugrave; o meno fedele del risultato delle modifiche che stai apportando prima di effettuare il salvataggio.\n&lt;/p&gt;\n&lt;p&gt;\nPer visualizzare l&#039;anteprima clicca su uno degli url che trovi nel box in alto a destra.\n&lt;/p&gt;\n&lt;p&gt;\nClicca sull&#039;icona posta in alto a destra nella barra del titolo per vedere una versione a grandezza reale.\n&lt;/p&gt;\n&lt;p&gt;\nNella barra del titolo sono inoltre presenti bottoni per ingrandire e rimpicciolire le dimensioni dell&#039;anteprima, nonch&egrave; per spostarsi a destra e sinistra.&lt;/p&gt;","it"), ("2768","2768","Visualizza a schermo pieno","it"), ("2769","2769","Ingrandisci","it"), ("2770","2770","Riduci","it"), ("2771","2771","Sposta a sinistra","it"), ("2772","2772","Sposta a destra","it"), ("2773","2773","Sposta su","it"), ("2774","2774","Sposta giu","it"), ("2775","2775","&lt;p&gt;\nIn quest&#039;area una volta selezionato il template su cui lavorare comparir&agrave; un numero di blocchi variabile (a seconda di quanti ne prevede il template selezionato).\n&lt;/p&gt;\n&lt;p&gt;\nOgni blocco &egrave; rappresentato da una finestra con un titolo. La finestra potr&agrave; essere vuota oppure contenere una serie di moduli. \n&lt;/p&gt;\n&lt;p&gt;\nIn ogni modulo saranno presenti i seguenti controlli:\n&lt;ul&gt;\n&lt;li&gt; icona &quot;4 frecce&quot;: &egrave; l&#039;area sensibile per lo spostamento (per decidere l&#039;ordine di apparizione dei moduli sul lato pubblico)\n&lt;li&gt; Menu a singola selezione per scegliere la vista da utilizzare (spesso sar&agrave; una sola, ma potrebbero essercene pi&ugrave; di una)&lt;/li&gt;\n&lt;li&gt; icona &quot;ingranaggio&quot; : per modificare eventuali valori di configurazione del modulo&lt;/li&gt;\n&lt;li&gt; icona &quot;info&quot;: se prevista dal modulo viene mostrata una breve documentazione che illustra le funzionalit&agrave; del modulo.&lt;/li&gt;\n&lt;li&gt;Cestino: rimuove il modulo dall&#039;elenco, ricorda per&ograve; che la rimozione avr&agrave; effetto solo dopo aver salvato.&lt;/li&gt;\n&lt;/ul&gt;\n&lt;/p&gt;","it"), ("2776","2776","&lt;p&gt;\nUna volta selezionato il template quest&#039;area verr&agrave; riempita con gli indirizzi internet delle pagine che utilizzano il template.\n&lt;/p&gt;\n&lt;p&gt;\nCliccando sull&#039;indirizzo verr&agrave; caricata l&#039;anteprima per la pagina selezionata nell&#039;apposita finestra.\n&lt;/p&gt;\n&lt;p&gt;\nAl caricamento del template viene auto-caricata l&#039;anteprima del primo indirizzo che comparir&agrave; nell&#039;elenco.\n&lt;/p&g